import React from 'react';
import ReactDOM from 'react-dom';
import 'antd/dist/antd.css';
import { Table, Divider, Tag } from 'antd';
import axios from 'axios';
class table extends React.Component {
  state = {};
  componentDidMount() {
    axios.get(`http://localhost:9090/application-processing/dvRecievedApplications`)
      .then(res => {
        // const posts = res.data.data.children.map(obj => obj.data);
        this.setState(res.data);
        console.log(res.data);
      });
  }
render(){
  console.log(this.state);
  var datbutton = "Delete";
  var button1 = <span>
    <button>{datbutton}</button>
  </span>;
  var columns = this.state['columns'];
  columns[6] = {title: "Button 1", dataIndex: "button1", key: "button1"};
  var data = this.state['rows'];
  data[0]["button1"] = button1;
  data[1]["button1"] = button1;
  data[2]["button1"] = button1; 
return (
<Table columns={columns} dataSource={data}/>
);
} }         
export default table;
